('21',17,2,'文字','加法性质：对于任意实数 a、b 和 c，如果 a < b，则有 a + c < b + c。\r\n\r\n减法性质：对于任意实数 a、b 和 c，如果 a < b，则有 a - c < b - c。\r\n\r\n乘法性质：对于任意实数 a、b 和 c，如果 a < b 且 c > 0，则有 ac < bc。如果 c < 0，则有 ac > bc。\r\n\r\n除法性质：对于任意实数 a、b 和 c，如果 a < b 且 c > 0，则有 a/c < b/c。如果 c < 0，则有 a/c > b/c。\r\n\r\n幂性质：对于任意实数 a、b 和正整数 n，如果 a < b，则有 a^n < b^n。但是当 n 为负奇数时，不等号方向会颠倒，即 a^n > b^n。\r\n\r\n取正性质：如果 a > 0，则对 a 取正不会改变不等关系，即如果 a < b，则有 |a| < |b|。\r\n\r\n绝对值不等式：对于任意实数 a 和 b，有 |a + b| ≤ |a| + |b|，这是绝对值的三角不等式。\r\n\r\n均值不等式：对于任意非负实数 a1, a2, …, an，有以下几个常见的均值不等式：\r\n\r\n算术均值不等式：(a1 + a2 + … + an)/n ≥ √(a1 * a2 * … * an)。\r\n几何均值不等式：√(a1 * a2 * … * an) ≥ (a1 + a2 + … + an)/n。',1,'2023-09-17 17:29:37'),
('22',2,17,'文字','厉害啊',1,'2023-09-17 17:30:35'),
('23',2,17,'文字','高中数学中，不等式是基础知识，在函数问题中占比较大，出题面广，难度大，解题比较繁琐。须把它整理出来，认真研究，学细、学深、学透，为备战高考奠定坚实基础。\r\n不等式是与等式相区别的，意思就是左边与右边不等，等式简单，就“=”一个符号，而不等式有“≠”、“>”、“<”、“≥”“≤”5种，“不等”就是有差距，我们学习不等式的其中一个目的就是掌握这种差距的思维。\r\n比较两个数（函数）的大小， 一是作差，二是作商（作除数的不能为零），这个容易理解吧，有了这种思维，不等式问题就好解决了。以下是高中阶段的不等式公式：',1,'2023-09-17 17:31:35'),
